import React from "react";
import style from "./keyboard.module.css";
import Display from "../display/display";
import { useState } from "react";

const KeyBoard = function (props) {
	function handleClick() {
		props.setValor(10);
	  }

    return (
        <div>
				<Display  />
            <table >
				<tbody className={style.tdLine}>
			
					<tr className={style.tdLine}></tr><tr className={style.tdLine}></tr><tr className={style.tdLine}></tr>
				
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick ={handleClick -1}>1</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {2}>2</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {3}>3</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {4}>4</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {5}>5</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {6}>6</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {7}>7</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {8}>8</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {9}>9</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick= {'delete'}>←</button></td>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick= {0}>0</button></td>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick= {'ok'}>√</button></td>
						<td></td>
					</tr>
				</tbody>
			</table>
        </div>
    );
};

export default KeyBoard;
